import React, {Component} from 'react';
import CountryCard from './CountryCard';

Countries = ({country}) => {
		return ( 
			<div>
			{ country.map((country, i) => {
				return (<CountryCard key={i} name={country[0].name.common} capital={country[0].capital[0]} continent={country[0].continents[0]} subregion={country[0].subregion} map={country[0].maps.googleMaps} unMember={country[0].unMember} population={country[0].population} flag={country[0].flags.png} />)
			})

			}
			</div>
		)
}

export default Countries
